import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as s from './ap'

ReactDOM.render(<>
	<ol>
	<li>{s.add(2,3)}</li>
	<li>{s.sub(3,2)}</li>
	<li>{s.mul(2,3)}</li>
	<li>{s.div(3,2)}</li>
	</ol>
	</>,document.getElementById("root"));
